column1:
O SECRETÁRIO DE ESTADO DE JUSTIÇA E CIDADANIA DO DISTRITO FEDERAL, no uso das
atribuições que lhe confere o artigo 113 do Regimento Interno aprovado pelo Decreto Distrital 34.320
de 26 de abril de 2013, e de acordo com o artigo 44 da Lei Complementar nº 840/2011, c/c §§ 1º
e 3º dos Decretos nº 33.551/2012 e nº 37.402/2016, resolve:
Art. 1º Instaurar a Comissão de Inventário Físico Patrimonial, exercício de 2019, da Secretaria de
Estado de Justiça e Cidadania do Distrito Federal, do Instituto de Defesa do Consumidor -
PROCON/DF, da Fundação de Amparo ao Trabalhador Preso - FUNAP/DF, bem como o acervo
patrimonial da extinta Secretaria de Estado de Políticas para Crianças, Adolescente e Juventude do
Distrito Federal.
Art. 2º A Comissão será constituída pelos seguintes servidores: ELIANE ALVES DA SILVA,
matrícula 02372142; LUIZ GUSTAVO PIMENTA MOREIRA, matrícula 224599-X; EDVALDO
FRANCISCO DE SOUZA, matrícula 02246465; ROBERTO PEREIRA LOPES, matrícula 02246228;
FRANCISCO ALBERTO FERREIRA, matrícula 027389-9; DANIELE RODRIGUES DE SOUSA
SILVA, matrícula 133555-3.
Parágrafo Único: A comissão será presidida por ELIANE ALVES DA SILVA, matrícula 02372142;
DANIELE RODRIGUES DE SOUSA SILVA, matrícula 133555-3, que será substituído, nos seus
eventuais impedimentos e afastamentos legais, por EDVALDO FRANCISCO DE SOUZA, matrícula
02246465.
Art. 3º Serão constituídas Subcomissões para realização do inventário nas unidades externas da
SEJUS, distribuídas da seguinte forma:
I - Subcomissão FUNAP, composta pelos servidores:
a) DANIEL CARVALHO SOUSA SANTANA, matrícula 224369-5;
A Subcomissão será presidida pelo servidor DANIEL CARVALHO SOUSA SANTANA, matrícula
224369-5;
II - Subcomissão da extinta SECRIA, composta pelos servidores:
a) TATIANA DE OLIVEIRA, matrícula 218010-3;
b) GIULIANA HERNANDES CORES, matrícula 234.436-X (SUBPPCA);
c) MANUELA RODRIGUES EWERTON SANTOS, matrícula 195.407-5 (SUBPPCA);
d) NAYARA FERREIRA CHIARELLI, matrícula 226114-6 (SUBPROTECA);
e) PAULO HENRIQUE CANDIDO AZEVEDO, matrícula 172.552-1 (SUBPROTECA);
f) CARLOS MARCELO GOMES LEITE, matrícula 197.211-1 (SUBSIS);
g) LEONARDO LEMOS VASCONCELOS, matrícula 221.700-7 (SUBSIS);
A Subcomissão será presidida pela servidora TATIANA DE OLIVEIRA, matrícula 218010-3;
III - Subcomissão PROCON, compostas pelos servidores:
a) SOFIA AYRES CARNEIRO MACHADO, matrícula 222043-1;
b) DAVID KALIL BATISTA PEREIRA, matrícula 222053-9;
c) THIAGO RODRIGUES DA SILVA, matrícula 227569-4;
d) RONILDO SILVA GOMES, matrícula 174.461-5;
A Subcomissão será presidida pela servidora SOFIA AYRES CARNEIRO MACHADO, matrícula
222043-1;
IV - Subcomissão SUBNAHORA compostas pelos servidores:
a) NILSON JOSÉ BORGES, matrícula 241869-X (SUBNAHORA);
b) VALDECI PEREIRA DA SILVA, matrícula 238894-4 (GESOB);
c) CLEOMAR DA COSTA PINHEIRO, matrícula 80.103-8 (GEGAM);
d) EDERSON ANTONIO SOUZA, matrícula 1430822-3 (GECEI);
e) FRANK ALEXANDRE COUTO ALVES, matrícula 118706-6 (GEROD);
f) FRANCISCO WESLEY LUZ BARROS, matrícula 118.625-6 (GEMP);
g) JOSÉ EDER MAGALHÃES BAIÃO, matrícula 125148-1 (GETAG)
A Subcomissão será presidida pelo servidor NILSON JOSÉ BORGES, matrícula 241869-X;
Art. 4º A Comissão de Inventário Físico Patrimonial deverá concluir os seus trabalhos em até 30
(trinta) dias após o vigor desta portaria, apresentando relatório final que conste registro patrimonial,
descrição, estado de conservação, localização dos bens móveis e imóveis e irregularidades, porventura,
verificadas, observando os fundamentos da Instrução Normativa SUCON/SEF nº 01, de 17 de agosto
de 2015 e da Instrução Normativa SUCON/SEF nº 04, de 11 de setembro de 2017.
Art. 5º Fica expressamente proibida a movimentação de bens patrimoniais até o término dos trabalhos
da Comissão.
Parágrafo Único - A Subsecretaria de Administração Geral, Secretaria de Estado de Justiça e
Cidadania do Distrito Federal poderá autorizar, excepcionalmente, a movimentação patrimonial de que
trata esta Portaria, desde que em comum acordo com o presidente da comissão.
Art. 6º Fica revogada a Portaria 03 de 08 de janeiro de 2019, publicada no DODF nº. 07 de 10 de
janeiro de 2019.
Art. 7º Esta Portaria entra em vigor na data de sua publicação.
GUSTAVO DO VALE ROCHA

Processo nº 1.340/2019; Beneficiário: CLÁUDIA FERNANDA DE OLIVEIRA PEREIRA; Evento:
